use my_app;

/*------------------------ create ------------------------*/

drop table if exists loans;
drop table if exists users;

drop table if exists mentors_skills;
drop table if exists mentors;
drop table if exists skills;

drop table if exists rooms_services;
drop table if exists rooms;
drop table if exists services;


drop table if exists licences_products;
drop table if exists licences;
drop table if exists products;


drop table if exists equipments_categories;
drop table if exists equipments;
drop table if exists categories;

/*users*/

/* admin_status: "user" || "admin" */

create table users(
    id              int             auto_increment not null,
    email           varchar(50)     not null unique,
    password        varchar(255)    not null,
    admin_status    varchar(50)     not null,
    image           mediumtext      ,
    primary key (id),
    fulltext (email)
);

/*loans*/

create table loans(
    id              int             auto_increment not null,
    start_time      datetime        not null,
    end_time        datetime        not null,
    returned        datetime        ,
    user_id         int             not null,
    item_type       varchar(50)     not null,
    item_id         int             not null,
    primary key (id),
    foreign key loans_user_key(user_id) references users(id)
);

/*mentors*/

create table mentors(
    id              int             auto_increment not null,
    email           varchar(50)     not null unique,
    first_name      varchar(50)     not null,
    last_name       varchar(50)     not null,
    description     varchar(255)    ,
    image           mediumtext      not null,
    created         datetime        ,
    modified        datetime        ,
    deleted         datetime        ,
    primary key (id),
    fulltext (email, first_name, last_name, description)
);

drop trigger if exists mentors_created_setter;
create trigger mentors_created_setter before insert on mentors
    for each ROW
        set new.created = now(), new.modified = now();

drop trigger if exists mentors_modified_setter;
create trigger mentors_modified_setter before update on mentors
    for each ROW
        set new.modified = now();

create table skills(
    id              int             auto_increment not null,
    name            varchar(50)     not null unique,
    description     varchar(255)    ,
    primary key (id),
    fulltext (name, description)
);

create table mentors_skills(
    mentor_id       int             not null,
    skill_id        int             not null,
    primary key (mentor_id, skill_id),
    foreign key mentors_skills_mentor_key(mentor_id) references mentors(id),
    foreign key mentors_skills_skill_key(skill_id) references skills(id)
);

